import React from 'react';
import '../styles.css';

const Footer = () => {
  return (
    <footer>
      <p>&copy; 2024 Rainbow Vista Art. All rights reserved.</p>
      <p>Address: 123 Art Lane, Creativity City, ART 45678</p>
      <p>Email: contact@rainbowvistaart.com</p>
    </footer>
  );
}

export default Footer;
